import axios from 'axios';

axios.defaults.withCredentials = true;

// const API_URL = "http://localhost:8000/";
const API_URL = "https://bcbproject.herokuapp.com/";

class component_service{


    getAll(){
        return axios
        .get(API_URL + "/group/")
        .then(response => {
            return response;
        })
    }
}

export default new component_service()
